import React from 'react';

function Podcasts() {
  return (
    <>
      <div style="padding-left: 25%">
        <h2>Checkout Joel's Podcasts</h2>
        <a href="https://baconsale.com">baconsale</a>
      </div>
    </>
  );
}

export default Podcasts;
